const Information = () => {
    const estadistica = "https://i.postimg.cc/JzmV3y5G/c1743e96-c54b-4d72-b921-379ceb24771f.png";
    return (
        <View style={styles.container}>
            <View>
                <Text style={styles.text}>INFORMACIÃ“N</Text>
                <Image source={{ uri: estadistica }} style={styles.estad} />
            </View>
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
        flex: 5,
        alignItems: 'center',
        backgroundColor: '#DEE1E6',
        marginTop: 35,
        marginLeft: 25,
        marginRight: 25,
        marginBottom: 35,
        borderRadius:10
    },
    text:{
        marginTop: 25,
        color: 'black',
        fontSize: 20,
        textAlign: 'center',
        fontWeight: 'bold',        
    },
    estad: {
        marginTop: 30,
        width: 200,
        height: 50, // Ajusta la altura deseada para la imagen
    },
})

export default Information;
